USE `tontapatt_db`;
DROP function IF EXISTS `CalcDistance`;
USE `tontapatt_db`
CREATE FUNCTION `CalcDistance`( Lat1 DOUBLE, Long1 DOUBLE, Lat2 DOUBLE, Long2 DOUBLE ) RETURNS double BEGIN DECLARE r INT; DECLARE phi1 DOUBLE; DECLARE phi2 DOUBLE; DECLARE dphi DOUBLE; DECLARE dlam DOUBLE; DECLARE a DOUBLE; DECLARE c DOUBLE; DECLARE d DOUBLE; SET r = 6371000; SET phi1 = Lat1 * PI() / 180; SET phi2 = Lat2 * PI() / 180; SET dphi = ( Lat2 - Lat1 ) * PI() / 180; SET dlam = ( Long2 - Long1 ) * PI() / 180; SET a = SIN( dphi / 2 ) * SIN( dphi / 2 ) + COS( phi1 ) * COS( phi2 ) * SIN( dlam / 2 ) * SIN( dlam / 2 ); SET c = 2 * ATAN2( SQRT( a ), SQRT( 1 - a ) ); SET d = r * c / 1000; RETURN d; END;